import React,{useState} from 'react';
import Task from "./Task";
const Todos = ({state,toggleCompleted}) => {

    return (
        <div>
            {state.map(todo => (
                <Task toggleCompleted={toggleCompleted} key={todo.id} todo={todo}/>
            ))}

        </div>
    );
};

export default Todos;
